  "codeLabFeaturedProject_HotPotato.projectName" : {
    "translation" : "Heiße Kartoffel"
  },
  "codeLabFeaturedProject_HotPotato.projectDescription" : {
    "translation" : "Wenn die Musik aufhört, sollte die heiße Kartoffel nicht bei dir sein!"
  },
  "codeLabFeaturedProject_HotPotato.projectInstructions" : {
    "translation" : "<span style='font-weight:bold;'>1.</span> Dies ist ein Spiel für zwei Spieler – und Cozmo. \u000a\u000a<span style='font-weight:bold;'>2.</span> Cozmo bittet dich, <span style='font-weight:bold;'>einen Cube unter seinen Hebearm zu legen</span>, damit er darauf tippen kann.\u000a\u000a<span style='font-weight:bold;'>3.</span> Bei diesem Spiel stellen die Cube-Lichter die 'Kartoffel' dar. Wenn die Kartoffel bei dir landet, werden die Lichter <span style='color:#ff0000'>rot</span>. Die Lichter werden <span style='color:#00ff00'>grün</span>, sobald die Kartoffel durch <span style='font-weight:bold;'>Antippen</span> des Cubes weitergegeben werden kann.\u000a\u000a<span style='font-weight:bold;'>4.</span> Wenn die Musik aufhört, sollte die Kartoffel nicht bei dir sein!"
  },
  "codeLabFeaturedProject_TinyOrchestra.projectName" : {
    "translation" : "Mini-Orchester!"
  },
  "codeLabFeaturedProject_TinyOrchestra.projectDescription" : {
    "translation" : "Jetzt hast du dein eigenes kleines Orchester, und die Cubes sind deine Instrumente!"
  },
  "codeLabFeaturedProject_TinyOrchestra.projectInstructions" : {
    "translation" : "<span style='font-weight:bold;'>1.</span> Stelle vor Spielbeginn sicher, dass die Audioausgabe des Geräts eingeschaltet ist.\u000a\u000a<span style='font-weight:bold;'>2.</span> <span style='font-weight:bold;'>Lege</span> 3 Cubes vor Cozmo.\u000a\u000a<span style='font-weight:bold;'>3.</span> Nach Spielbeginn leuchten die Lichter der Cubes in verschiedenen Farben. <span style='font-weight:bold;'>Tippe</span> auf einen Cube, um dessen Instrument zu spielen. <span style='font-weight:bold;'>Tippe</span> erneut darauf, um zu einem anderen Instrument zu wechseln.\u000a\u000a<span style='font-weight:bold;'>4.</span> Experimentiere mit den verschiedenen musikalischen Möglichkeiten!"
  },
  "codeLabFeaturedProject_MagicFortuneTeller.projectName" : {
    "translation" : "Wahrsager"
  },
  "codeLabFeaturedProject_MagicFortuneTeller.projectDescription" : {
    "translation" : "Schüttele Cozmo, und lass dir deine Zukunft vorhersagen."
  },
  "codeLabFeaturedProject_MagicFortuneTeller.projectInstructions" : {
    "translation" : "<span style='font-weight:bold;'>1.</span> Tippe auf 'Starten'. Wenn auf dem Gesicht von Cozmo '?' zu sehen ist, kannst du ihm eine Ja-oder-Nein-Frage stellen.\u000a\u000a<span style='font-weight:bold;'>2.</span> <span style='font-weight:bold;'>Schüttle</span> Cozmo, um dir die Zukunft vorhersagen zu lassen!\u000a\u000a<hr style='background-color:#bbb; color:#bbb; border:none; height:1px'><span style='font-size:80%; font-color:#ddd'>Hierzu brauchst du keine Cubes!</span>"
  },
  "codeLabFeaturedProject_CubeWhack.projectName" : {
    "translation" : "Hau den Cube"
  },
  "codeLabFeaturedProject_CubeWhack.projectDescription" : {
    "translation" : "Bist du schnell genug? Was ist dein Highscore?"
  },
  "codeLabFeaturedProject_CubeWhack.projectInstructions" : {
    "translation" : "<span style='font-weight:bold;'>1.</span> <span style='font-weight:bold;'>Lege</span> vor Spielbeginn 3 Cubes vor Cozmo.\u000a\u000a<span style='font-weight:bold;'>2.</span> Das Rucksack-Licht von Cozmo leuchtet nun in einer bestimmten Farbe. <span style='font-weight:bold;'>Tippe</span> schnell auf den Cube mit der gleichen Farbe.\u000a\u000a<span style='font-weight:bold;'>3.</span> <span style='font-weight:bold;'>Tippe</span> auf so viele übereinstimmende Cubes wie möglich, bevor die Zeit abgelaufen ist!\u000a\u000a<span style='font-weight:bold;'>4.</span> Kannst du deinen Highscore schlagen?"
  },
  "codeLabFeaturedProject_FiretruckAlarm.projectName" : {
    "translation" : "Cozmos Timer"
  },
  "codeLabFeaturedProject_FiretruckAlarm.projectDescription" : {
    "translation" : "Ticktack! Ein Timer macht viel mehr Spaß, wenn es ein Cozmo ist."
  },
  "codeLabFeaturedProject_FiretruckAlarm.projectInstructions" : {
    "translation" : "<span style='font-weight:bold;'>1.</span> Tippe auf die Startfahne. Nun beginnt ein 10-sekündiger Timer.\u000a\u000a<span style='font-weight:bold;'>2.</span> Wenn der Timer abgelaufen ist, ertönt der Alarm von Cozmo!\u000a\u000a<hr style='background-color:#bbb; color:#bbb; border:none; height:1px'><span style='font-size:80%; font-color:#ddd'>Hierzu brauchst du keine Cubes!</span>"
  },
  "codeLabFeaturedProject_LightShow.projectName" : {
    "translation" : "Lichtshow"
  },
  "codeLabFeaturedProject_LightShow.projectDescription" : {
    "translation" : "Schalte das Licht im Zimmer aus und tanze zur Musik."
  },
  "codeLabFeaturedProject_LightShow.projectInstructions" : {
    "translation" : "<span style='font-weight:bold;'>1.</span> <span style='font-weight:bold;'>Schalte das Licht aus</span>, bevor du das Spiel startest.\u000a\u000a<span style='font-weight:bold;'>2.</span> Cozmo führt mit seinen Cubes eine Lichtschau auf und tanzt zur Musik!"
  },
