  "codeLabGlossary.block_definitions.title.cozmo_vert_cube_get_is_visible" : {
    "translation" : "Ist Cube [#] sichtbar"
  },
  "codeLabGlossary.block_definitions.description.cozmo_vert_cube_get_is_visible" : {
    "translation" : "Gibt \"wahr\" oder \"falsch\" zurück – je nachdem, ob der angegebene Cube sichtbar ist. Wenn ein Cube als \"sichtbar\" angegeben ist, bedeutet dies, dass Cozmo seine Markierung deutlich sehen kann. Daher muss sich der gesamte Cube im Sichtfeld von Cozmo befinden, darf aber nicht zu nah sein. Außerdem dürfen die Lichtverhältnisse nicht zu hell oder dunkel sein. Cube 1: Sieht aus wie eine Büroklammer. Cube 2: Sieht aus wie eine Lampe oder ein Herz. Cube 3: Sieht aus wie ein Baby in einem Kindersitz."
  },
