  "codeLabSampleProject_LaserSmile.projectName" : {
    "translation" : "Laser-Lächeln!"
  },
  "codeLabFeaturedProject_LaserSmile.projectDescription" : {
    "translation" : "Gewinne mit einem Lächeln!"
  },
  "codeLabFeaturedProject_LaserSmile.projectInstructions" : {
    "translation" : "<span style='font-weight:bold;'>1.</span> Tippe auf die Startfahne. Cozmo zeigt nun ein Stirnrunzel-Emoji an.\u000a\u000a<span style='font-weight:bold;'>2.</span> Stelle sicher, dass Cozmo dein Gesicht sehen kann. <span style='font-weight:bold;'>Bewege deinen Kopf</span>, um auf das Stirnrunzel-Emoji zu zielen.\u000a\u000a<span style='font-weight:bold;'>3.</span> <span style='font-weight:bold;'>Lächle</span>, um einen Laserstrahl abzufeuern!\u000a\u000a<hr style='background-color:#bbb; color:#bbb; border:none; height:1px'><span style='font-size:80%; font-color:#ddd'>Hierzu brauchst du keine Cubes!</span>"
  },
